description:
This is a sync of sorts that plays the final five tracks of Tool's 2001 album Lateralus over the final segment of Stanley Kubrick's 2001: A Space Odyssey. The real magic begins when &quot;Jupiter and Beyond the Infinite Begins.&quot; Tool fans should enjoy this.

